import React, { useEffect, useState } from 'react';

const Dashboard = () => {
  const [weeklyCommission, setWeeklyCommission] = useState([]);
  const [violationsARs, setViolationsARs] = useState([]);
  const [loading, setLoading] = useState(true);

  const userEmail = localStorage.getItem('userEmail');

  useEffect(() => {
    const fetchData = async () => {
      try {
        const response = await fetch('http://localhost:5000/data');
        const data = await response.json();

        // Filter data for the logged-in user
        const agentWeeklyCommission = data.weeklyCommission.filter(
          (item) => item.emails === userEmail
        );

        const agentViolationsARs = data.scanningViolationsAndARs.filter(
          (item) => item.emails === userEmail
        );

        setWeeklyCommission(agentWeeklyCommission);
        setViolationsARs(agentViolationsARs);
        setLoading(false);
      } catch (error) {
        console.error('Error fetching dashboard data:', error);
        setLoading(false);
      }
    };

    fetchData();
  }, [userEmail]);

  if (loading) {
    return <div>Loading your dashboard...</div>;
  }

  return (
    <div>
      <h1>Dashboard Page</h1>
      <h2>Welcome, {userEmail}</h2>

      <h3>Weekly Commission</h3>
      {weeklyCommission.length > 0 ? (
        <table border="1">
          <thead>
            <tr>
              <th>Agent Name</th>
              <th>Commission Week</th>
              <th>New Business</th>
              <th>Rewrite</th>
              <th>Gross Pay</th>
              {/* Add more headers as needed */}
            </tr>
          </thead>
          <tbody>
            {weeklyCommission.map((entry, index) => (
              <tr key={index}>
                <td>{entry.agentname}</td>
                <td>{entry.commissionweek}</td>
                <td>{entry.newbusiness}</td>
                <td>{entry.rewrite}</td>
                <td>{entry.grosspay}</td>
                {/* Add more cells as needed */}
              </tr>
            ))}
          </tbody>
        </table>
      ) : (
        <p>No weekly commission data found.</p>
      )}

      <h3>Scanning Violations and ARs</h3>
      {violationsARs.length > 0 ? (
        <table border="1">
          <thead>
            <tr>
              <th>Week</th>
              <th>AR Customer Name</th>
              <th>AR Fee Amount</th>
              <th>AR Details</th>
              <th>SV Customer Name</th>
              <th>SV Fee Amount</th>
              <th>SV Details</th>
              {/* Add more headers as needed */}
            </tr>
          </thead>
          <tbody>
            {violationsARs.map((entry, index) => (
              <tr key={index}>
                <td>{entry.week}</td>
                <td>{entry.arcustomername}</td>
                <td>{entry.arfeeamount}</td>
                <td>{entry.ardetails}</td>
                <td>{entry.svcustomername}</td>
                <td>{entry.svfeeamount}</td>
                <td>{entry.svdetails}</td>
                {/* Add more cells as needed */}
              </tr>
            ))}
          </tbody>
        </table>
      ) : (
        <p>No scanning violations or AR data found.</p>
      )}
    </div>
  );
};

export default Dashboard;
